import React from "react";
import { Container } from 'react-bootstrap';
import Layout from './layouts/Layout';
import MultiAquarium from "./pages/MultiAquarium";

import "./App.css";

function App() {
  return (
    <Layout>
      <div className="App">
        <MultiAquarium />
      </div>
    </Layout>
  );
}

export default App;
